package com.victor.model.data;import java.io.Serializable;import java.util.List;/** * Created by victor on 2017/5/9. */public class GankData implements Serializable {    private boolean error;    private List<GankInfo> results;    public void setError(boolean error) {        this.error = error;    }    public void setResults(List<GankInfo> results) {        this.results = results;    }    public boolean isError() {        return error;    }    public List<GankInfo> getResults() {        return results;    }}